/*Data for the table `brand` */

insert  into `brand`(`brand_id`,`brand_name`,`brand_area`,`brand_logos`,`brand_summary`,`brand_category_id`,`createdate`,`lastmodify`,`expiredate`,`status`,`brand_maintype_id`) values (1,'星巴克','美国','/data/brandlogos/starbucks.jpg','星巴克（Starbucks）咖啡公司成立于1971年，是世界领先的特种咖啡的零售商，烘焙者和星巴克品牌拥有者。旗下零售产品包括30多款全球顶级的咖啡豆、手工制作的浓缩咖啡和多款咖啡冷热饮料、新鲜美味的各式糕点食品以及丰富多样的咖啡机、咖啡杯等商品。此外，公司通过与合资伙伴生产和销售瓶装星冰乐咖啡饮料、冰摇双份浓缩咖啡和冰淇淋，通过营销和分销协议在零售店以外的便利场所生产和销售星巴克咖啡和奶油利口酒，并不断拓展泰舒茶、星巴克音乐光盘等新的产品和品牌。\r\n　　1987年，现任董事长霍华德?舒尔茨先生收购星巴克，从此带领公司跨越了数座业务发展的里程碑。1992年6月，星巴克作为第一家专业咖啡公司成功上市，迅速推动了公司业务增长和品牌发展。目前公司已在北美，拉丁美洲，欧洲，中东和太平洋沿岸37个国家拥有超过12,000多家咖啡店，拥有员工超过117，000人。长期以来，公司一直致力于向顾客提供最优质的咖啡和服务，营造独特的“星巴克体验”，让全球各地的星巴克店成为人们除了工作场所和生活居所之外温馨舒适的“第三生活空间”。与此同时，公司不断地通过各种体现企业社会责任的活动回馈社会，改善环境，回报合作伙伴和咖啡产区农民。鉴于星巴克独特的企业文化和理念，公司连续多年被美国《财富》杂志评为“最受尊敬的企业”。\r\n　　星巴克看好中国市场的巨大潜力，立志于在中国长期发展，与中国经济共同成长。自1999年进入中国以来，星巴克已在包括香港、台湾和澳门在内的大中华区开设了430多家门店，其中约200家在大陆地区。目前，星巴克正积极拓展大陆二线市场，致力于在不久的将来使中国成为星巴克在美国之外最大的国际市场。此外，公司秉承在全球一贯的文化传统，积极融入中国地方社区和文化，做负责任的中国企业公民。 2005年9月，公司出资4000万元人民币设立 “星巴克中国教育项目”，专门用于改善中国教育状况，特别是帮助中西部贫困的地区的教师和学生。其中首笔捐赠已与中国宋庆龄基金会合作开展“西部园丁培训计划”。\r\n　　2005年底，星巴克在上海成立中华区总部，主要负责星巴克大中华区战略发展、市场开拓和营运等事务。',7,'2009-07-20 20:51:11','2009-07-20 20:51:11','2009-10-20 20:51:11',0,2),(2,'Nokia','芬兰','/data/brandlogos/logo_nokia_china_75_41.gif','[诺基亚在中国]\r\n诺基亚在中国\r\n诺基亚公司是一家移动通信产品跨国公司，总部位于芬兰。在移动电话产品市场上，诺基亚已经多年占据市场份额第一的位置。2005年，诺基亚公司手机发货量约2.64亿部，是位于第二名的摩托罗拉公司的1.8倍（其发货量为1.45亿台，市场份额约17.7%），占了全球市场份额的32.1％。此外，它在通信网络设备制造（主要是GSM和WCDMA网络）及移动多媒体应用开发等领域的实力也处于世界前列，并可为企业级的用户提供无线连通解决方案。\r\n　　1990年的诺基亚，因产业领域过宽而濒于破产。后来老总决定只认准一点——手机，将其他产业全部舍弃（包括卖掉一个年利润800万美元的制药厂），5年后它便东山再起了。\r\n　　如今，诺基亚公司专注于移动通信相关产品的研发与制造，包括移动电话产品及多媒体、娱乐、通信网络和企业级的解决方案。诺基亚是移动通信的全球领先者，致力于提供易用和安全的产品，包括移动电话、图像、游戏、媒体以及面向移动网络运营商和企业用户的解决方案，从而丰富人们的生活，提升其工作效率。诺基亚股票在全球五个主要证券市场上市，股东遍布世界各地。\r\n　　2007年，诺基亚公司实现净销售额511亿欧元（约合761亿美元），利润收入达72亿欧元（约合106亿美元）。截至2005年底，公司在全球8个国家拥有14家工厂，并在11个国家设立了研发中心，雇员人数达到了约58800人。作为一家公众持股的公司，诺基亚分别在芬兰的赫尔辛基、瑞典的斯德哥尔摩、法国的巴黎、德国的法兰克福以及美国的纽约挂牌上市。\r\n　　诺基亚可持续发展目标\r\n　　诺基亚坚信：在我们所有的业务领域，支持可持续发展是公司长期成功的重要因素，同时也是诺基亚在移动通信产业处于领先位置的关键，诺基亚的目标是在可持续发展的产品和服务中成为领头羊。',5,'2009-07-20 20:54:21','2009-07-20 20:54:21','2009-10-20 20:54:21',0,2),(3,'首都机场','中国北京','/data/brandlogos/plane.jpeg','北京首都国际机场简称首都机场，是中华人民共和国北京市的主要的国际机场。北京首都国际机场位于北京市区东北方向，朝阳区在顺义区的一块飞地，距离天安门广场25.35公里。中国地理位置最重要、规模最大、设备最齐全、运输生产最繁忙的大型国际航空港。北京首都国际机场不但是中国首都北京的空中门户和对外交往的窗口，而且是中国民航最重要的航空枢纽，是中国民用航空网络的辐射中心。并且是当前中国最繁忙的民用机场。也是中国国际航空公司的基地机场。\r\n　　北京首都国际机场拥有三座航站楼，两条4E级跑道、一条4F级跑道，以及旅客、货物处理设施。是中国国内唯一拥有三条跑道的国际机场，机场原有东、西两条4E级双向跑道，长宽分别为3800×60米、3200×50米，并且装备有II类仪表着陆系统；其间为一号航站楼、二号航站楼。2008年建成的三号航站楼和第三条跑道（3800米×60米，满足F类飞机的使用要求）位于机场东边。\r\n　　北京首都国际机场股份有限公司于1999年10月15日在中华人民共和国首都北京注册成立，拥有并经营管理北京首都国际机场。',NULL,'2009-07-20 20:55:53','2009-07-20 20:55:53','2009-10-20 20:55:53',0,1),(4,'希尔顿酒店','美国','/data/brandlogos/hiltonlogo.gif','希尔顿国际酒店集团(HI)，为总部设于英国的希尔顿集团公司旗下分支，拥有除美国外全球范围内“希尔顿”商标的使用权。美国境内的希尔顿酒店则由希尔顿酒店管理公司(HHC)拥有并管理。希尔顿国际酒店集团经营管理着403间酒店，包括 261间希尔顿酒店，142间面向中端市场的“斯堪的克”酒店，以及与总部设在北美的希尔顿酒店管理公司合资经营的、分布在12个国家中的18间“康拉德 ”(亦称“港丽”)酒店。它与希尔顿酒店管理公司组合的全球营销联盟，令世界范围内双方旗下酒店总数超过了2700间，其中500多间酒店共同使用希尔顿的品牌。希尔顿国际酒店集团在全球80个国家内有着逾71000名雇员。',6,'2009-07-20 20:57:40','2009-07-20 20:57:40','2009-10-20 20:57:40',0,2),(5,'北京火车西站','中国北京','/data/brandlogos/train.jpeg','北京西站，又称北京西，位于北京市西三环附近，坐落在莲花池东路，是1996年初竣工的北京铁路客运站，是亚洲规模最大的现代化铁路客运站之一。 是亚洲规模最大的人口集散地和交通枢纽；是北京乃至全国对外开放的重要窗口。它每年中转，运输三亿以上的中外客流。北京西客站地处京城要塞，南衔广安门、北接中华世纪坛、东西有莲花大道贯通，附近有长途汽车站，地理位置优越。 ',NULL,'2009-07-20 20:59:06','2009-07-20 20:59:06','2009-10-20 20:59:06',0,1);

